            return;
        }

        protocol.Log(8, 5, $"Generating extra data");
        protocol.Datagenerated = $"Generating extra data...";

        var startTime = DateTime.FromOADate(Convert.ToDouble(protocol.Starttime));
        var lastRow = int.Parse(protocol.Lastrownumber.ToString(), CultureInfo.InvariantCulture);
        double lastValue = Convert.ToDouble(protocol.GetParameterIndexByKey(Parameter.Sfps.tablePid, Data.RowIndex, 2));
        var data = Data.GenerateDownwardSlope(lastValue);

        var extraStartTime = Data.GetData().GetValue(startTime, lastRow + 1).Item1;
        for (int j = 0; j < Data.ExtraDataPoints; j++)
        {
            var (time, value) = data.GetValue(extraStartTime, j);
            protocol.SetRow(Parameter.Sfps.tablePid, Data.RowIndex, new object[2] { Data.RowIndex, value }, time, false);
            Thread.Sleep(TimeSpan.FromMilliseconds(25));
        }

        protocol.Datagenerated = $"Extra data pushed";
    }
